css:
@-moz-document domain("foreigngirlfriend.com") {
body {background: black url("http://cdn26.us3.fansshare.com/photo/wallpapers1024x768/hd-wallpapers-anime-horror-fondos-de-pantalla-para-pc-taringa-wallpaper-with-wallpaper-2142320182.jpg") fixed; background-size: 100% 100%;} 
  .button.active {background: red}
  /*.main-content .content, .main-wrapper, .b-feed, .b-profile-content {background: rgba(0,0,40,.20); border-color: blue}*/
  .main-content .content, .main-wrapper, .b-feed, .b-profile-content {background: rgba(0,0,40,.20); border: none; box-shadow: 0px 0px 10px 2px rgba(100, 0, 0, 0.5)}
  .b-loader-tooltip {background: rgba(80,0,0,.40); color: red; border: solid 1px red; margin-top: 5px; border-top-left-radius: 10px; border-top-right-radius: 10px}
  .b-search-settings .box-content, .messenger-input .message-input {background: rgba(0, 0, 55, .5); color: aqua; border: solid 1px blue; border-top-left-radius: 10px; border-top-right-radius: 10px}
  .left-block .list-men-content {background: rgba(0, 30, 0, .5); color: green; border: solid 1px green}
  .b-autologin .text-altologin {background: rgba(40, 0, 0, .5); color: red; border-color: red}
  .list-men-content .b-men-activity .btn, h3.title {color: green}
  .member-info, .main-content .right-block {color: aqua}
  .b-top {background: rgba(80, 0, 0, .5); border: solid 1px red; border-left: none; border-right: none}
  .b-main-nav {background: transparent; border: none}
  select {border-color: blue; color: red; background-color: rgba(0, 0, 50, .5); border-radius: 10px}
  .b-search-pagination, .b-search-menu {background: none}
  .list-men .list-men-content {background: rgba(50, 0, 40, .5); border-color: blue; border-bottom-left-radius: 10px; border-bottom-right-radius: 10px}
  .list-men .list-men-content.new, .list-men .list-men-content:hover {background: rgba(200, 0, 0, .3)}
  .list-men .list-men-header {background: rgba(40, 0, 0, .5); border-color: red}
  .b-members .list-activity .item:nth-child(2n), .b-members .list-activity .item:first-child {display: none}
  .b-members .list-activity .item {width: 100%}
  .b-search-pagination {border: none}
  .manager-panel .item {color: yellow}
  .b-feed-user div.b-user-feed.isNew {background: rgba(100,100,0,.5) !important; color: yellow; border-color: yellow}
  .b-feed .b-feed-user .b-feed-content .b-info-feed {color: white}
  .b-feed .b-feed-user .b-feed-content .b-info-feed .switchContactsButtonLink span {color: red}
  .b-feed .b-feed-user .b-feed-content, .b-feed .b-feed-user .b-user-feed {background: rgba(0,0,0, .3); border-color: blue}
  .b-profile .b-slide-gallery.gift-carousel {background: none; color: white}
  .b-profile-content .list-characters .item span, h4 {color: red}
  .b-profile-content .b-profile-full-info .title, .b-profile-content .b-member-activity .name {color: orange}
  .chat-window, .messenger-input {background: none}
  h2, h2 a, .b-box > .title {color: white}
  .b-members .b-info {background: rgba(14, 20, 92,.65)}
  /*.b-members .member {width: 100px; height: 25px; padding-top: 2px}*/
  .btn-older-history.inactive {background: none; border-color: aqua}
  .chat-window, .messenger-input, .b-inbox .b-template-box {border-color: aqua; box-shadow: 0px 0px 5px 1px white}
  /*.main-content .left-block {opacity: 0.2; transition-duration: 1s}*/
  /*.main-content .left-block:hover {opacity: 1; transition-duration: 0s}*/
  .main-content .left-block {opacity: 0.0; width: 2px; transition-duration: 1s; height: 5px}
  .main-content .left-block:hover {width: 27%; transition-duration: 1s; opacity: 1}
  .b-notif-wrapper .b-notif-container {opacity: 0.1; transition-duration: 2s}
  .b-notif-wrapper .b-notif-container:hover {opacity: 1}
  .b-members .member {width: 5%}
  .b-members .main-photo img {min-width: 100%; height: 100%; width: 100%}
  .button, .main-button, .other-button, .facebook-button, .disabled-button, .invisible-button, .green {transition: 0s}
  .b-inbox .b-inbox-content {background: rgba(255,255,255,0.1)}
  h3 a:focus {color: blue}

}
